css:
/* AGENT_SHEET */
@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("wikipedia.org") {

/**********/
/*Defaults*/
/**********/
body,html,head,foot,table,td,tr,th{background:transparent!important;color:#fff!important;}
h1,h2,h3,h4{color:#aff!important;}
a{color:#9df!important;}

[border="1"]{background:#222!important;border-color:#555!important;}
[bgcolor="#ffffbb"]{background:#440!important;}
[bgcolor="#ffbbff"]{background:#404!important;}
[bgcolor="#bbffff"]{background:#044!important;}
[bgcolor="#bbbbff"]{background:#004!important;}
[bgcolor="#999999"]{background:#222!important;}

#footer{background:#000!important;}

input *,textarea *{background:#000!important;color:#fff!important;border-color:#555!important;}
/****************************/
/*Top of the page navigation*/
/****************************/
.pBody ul li a{background:transparent!important;}

#ca-nstab-main,#ca-talk,#ca-viewsource,#ca-history,#ca-watch,#ca-edit,li.selected
{
background:#000!important;border-color:#555!important;
-moz-border-radius-topleft:25%!important;
-moz-border-radius-topright:25%!important;
}

#mp-topbanner
{
background-color:#000!important;
border-color:#555!important;
-moz-border-radius-topright:25%!important;
-moz-border-radius-bottomleft:25%!important;
-moz-border-radius-bottomright:25%!important;
}
#mp-topbanner div{color:#fff!important;}

#mp-strapline{background:transparent!important;}
/*****************************************************/
/*This section changes the front page left side menus*/
/*****************************************************/
#p-navigation .pBody,#p-search .pBody,#p-interaction .pBody,#p-tb .pBody,#p-coll-create_a_book .pBody,#p-lang .pBody
{
background:#000!important;color:#fff!important;border-color:#555!important;
-moz-border-radius-topright:25%!important;
-moz-border-radius-bottomleft:25%!important;
-moz-border-radius-bottomright:25%!important;
}

/*This changes the left side menu tabs*/
h5
{
background:#555!important;color:#fff!important;border-color:#555!important;
-moz-border-radius-topleft:25%!important;
-moz-border-radius-topright:25%!important;
}

/*********************************************************/
/*Main Page content area, the biggest part of your screen*/
/*********************************************************/
#content
{
background:#000!important;color:#fff!important;border-color:#555!important;}

.MainPageBG{border-color:#555!important;background-color:#000!important;}

/*Today's Featured Article, and the one underneath it (left side)*/
#mp-left{background-color:#010!important;}
#mp-left td,#mp-left th{background:#010!important;border:none!important;}
#mp-tfa-h2,#mp-dyk-h2
{
background:#020!important;color:#fff!important;border-color:#030!important;
-moz-border-radius-topleft:25%!important;
-moz-border-radius-topright:25%!important;
-moz-border-radius-bottomleft:25%!important;
-moz-border-radius-bottomright:25%!important;
}

/*The right part: In the news, On this day, blah blah*/
#mp-right{background-color:#001!important;}
#mp-right td,#mp-right th{background:#001!important;border:none!important;}
#mp-itn-h2,#mp-otd-h2
{
background:#003!important;color:#fff!important;border-color:#005!important;
-moz-border-radius-topleft:25%!important;
-moz-border-radius-topright:25%!important;
-moz-border-radius-bottomleft:25%!important;
-moz-border-radius-bottomright:25%!important;
}

/*Today's featured pornographic*/
#mp-tfp tr td,.MainPageBG table{background:#101!important;}
#mp-tfp th{background:#101!important;border:none!important;}
#mp-tfp-h2,#mp-tfp-h2
{
background:#202!important;color:#fff!important;border-color:#505!important;
-moz-border-radius-topleft:25%!important;
-moz-border-radius-topright:25%!important;
-moz-border-radius-bottomleft:25%!important;
-moz-border-radius-bottomright:25%!important;
}

/*Bottom Nav stuff (catlinks)*/
.catlinks{background-color:#033!important;border-color:#055!important;}

/***********/
/*Articles!*/
/***********/
.wikitable,.wikitable td{background:#022!important;border-color:#055!important;}
.wikitable th{background:#033!important;border-color:#055!important;}

.toc{background:#222!important;border-color:#555!important;-moz-border-radius:5%!important;}

.mbox-small,.mbox,.mbox-large{background:#033!important;border-color:#055!important;}
.ambox-content,.ambox{background:#220!important;border-color:#550!important;}

[class="shortcutbox noprint"],
[class="noprint tright portal"] table,
[class="noprint tleft portal"] table
{background:#222!important;border-color:#555!important;}

.navbox{background:#101!important;border-color:#505!important;}
.navbox th,.navbox div,.navbox table{background:#202!important;}
.navbox-group{background:#202!important;}
.navbox-abovebelow{background:#101!important;}
[class="navbox-list navbox-odd"],[class="navbox-list navbox-odd"] div{background:#101!important;border-color:#101!important;}
[class="navbox-list navbox-even"]{background:#202!important;border-color:#202!important;}

.thumbinner,.thumbimage,[class="thumb tleft"],[class="thumb tright"],[class="thumb tnone"]
{
background:#022!important;border-color:#055!important;
-moz-border-radius-bottomleft:10%!important;
-moz-border-radius-bottomright:10%!important;
}
.thumbcaption
{
background-color:#033!important;text-align:center!important;
-moz-border-radius-bottomleft:10%!important;
-moz-border-radius-bottomright:10%!important;
}

/*****************/
/*Discussion Page*/
/*****************/
.tmbox{background:#022!important;border-color:#055!important;}
.tmbox th{background:#033!important;border-color:#055!important;}
#talkheader td{background:#022!important;}
[class="collapsible collapsed"] td{background:#022!important;}
.tmbox td{border-color:#055!important;}

.todo-box{background:#222!important;}

.infobox,.infobox td{background:#022!important;border-color:#055!important;color:#fff!important;}
.infobox th{background:#033!important;border-color:#055!important;}

/*Edit This Page*/
.fmbox{background:#222!important;border-color:#555!important;}
.mbox-text table{background:#222!important;border-color:#555!important;}

/**************/
/*History Page*/
/**************/
#mw-history-compare li{border-color:#222!important;}
#mw-history-compare li.selected{background:#222!important;border-color:#333!important;}

.diff-marker{background:#222!important;}
.diff-context{background:#222!important;}
.diff-deletedline{background:#442!important;}

/***********/
/*Watch Tab*/
/***********/
#mw-js-message{background:#222!important;border-color:#555!important;}

/*********************/
/*My Preferences Page*/
/*********************/
.jsprefs,#preftoc li,.mw-input select,.mw-input option *{color:#fff!important;background:#000!important;border-color:#555!important;}
legend{background:#033!important;border:1px solid #055!important;-moz-border-radius:25%!important;}

/****************************************************************************************************/
/* two huge blocks of inline images, first for the puzzle globe, second for the book background jpg */
/****************************************************************************************************/
[style="background-image: url(/images/wiki-en.png);"]
{
	background-image: url("data:image/png;base64,") !important;
}

body
{
	background: #1A1A1A url("data:image/png;base64,?") 0 0 no-repeat !important;
	color: #FFFFFF !important;
}

}
